        width: 90%;
        margin: 3rem 0;
    }
`;

export const ExperienceContentHeader = styled.div`
    border: 1px solid red;
`;

export const SubTitle = styled.p`
    color:  #dce3e6;
    text-align: left;
    margin-top: -25px;  
    font-weight: 600;
    letter-spacing: 2px;
`;
